import React from "react";
import { NavLink } from "react-router-dom";

const Header = () => {
  return (
    <div className="header">
        <NavLink to='/allbooks'>Books</NavLink>
        <NavLink to='/allstudents'>Students</NavLink>
        <NavLink to='/addbook'>New Book</NavLink>
        <NavLink to='/newstudent'>New Student</NavLink>
        <NavLink to='/deletedbooks'>Restore Books</NavLink>
    </div>
  );
};

export default Header;
